import { Search as SearchIcon } from "@mui/icons-material";
import { InputBase } from "@mui/material";



const Search=()=>{
    return(
        <Box>
            <Box>
                <Box>
                    <SearchIcon/>
                </Box>
                <InputBase/>
            </Box>
        </Box>
    )
}
export default Search;
